+  object-fit: cover;
+}
+
+.option label {
+  display: block;
+  cursor: pointer;
+}
+
+.option input[type="checkbox"],
+.option input[type="radio"] {
+  display: none;
+}
+
+.option input:checked + label {
+  font-weight: bold;
+  color: #3498db;
+}
+
+.option.other {
+  flex-basis: 100%;
+  display: flex;
+  align-items: center;
+  justify-content: flex-start;
+}
+
+.other-input {
+  display: none;
+  margin-left: 10px;
+  padding: 5px;
+  border: 1px solid #ccc;
+  border-radius: 4px;
+  width: 200px;
+}
+
+.submit-button {
+  display: block;
+  width: 100%;
+  padding: 12px;
+  background-color: #3498db;
+  color: #fff;
+  border: none;
+  border-radius: 4px;
+  font-size: 18px;
+  cursor: pointer;
+  transition: background-color 0.3s ease;
+}
+
+.submit-button:hover {
+  background-color: #2980b9;
+}
+
+/* Styles for the second question with big images */
+#question2 .options,
+#question3 .options {
+  display: grid;
+  grid-template-columns: repeat(1, 1fr);
+  gap: 20px;
+}
+
+#question2 .option,
+#question3 .option {
+  flex-basis: 100%;
+}
+
+#question2 .option img,
+#question3 .option img {
+  height: auto;
+  object-fit: cover;
+}
+
+/* Styles for the feedback textarea */
+#feedback {
+  width: 100%;
+  padding: 10px;
+  border: 1px solid #ccc;
