+.running-line-container {
+  width: 100%;
+  overflow: hidden;
+  background-color: #f0f0f0;
+  padding: 30px 0;
+}
+
+.running-line {
+  display: flex;
+  width: 200%;
+  animation: runningLine 30s linear infinite;
+}
+
+.units {
+  display: flex;
+  width: 50%;
+
+
+.units div {
+  flex: 1;
+  font-size: 64px; /* Increased font size */
+  font-weight: bold;
+  color: #38a169;
+  white-space: nowrap;
+  padding: 0 40px; /* Increased padding */
+}
+
+@keyframes runningLine {
+  0% {
+    transform: translateX(0);
+  }
+  100% {
+    transform: translateX(-50%);
+  }
+}
+
+/* Responsive adjustments */
+@media (max-width: 768px) {
+  .units div {
+    font-size: 48px; /* Slightly smaller on mobile */
+    padding: 0 30px;
+  }
+}

